{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/eta43riteshkumar/bellabeat-case-study-2-gdac?scriptVersionId=124591171\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"caa79659","metadata":{"papermill":{"duration":0.008357,"end_time":"2023-04-04T16:52:44.034136","exception":false,"start_time":"2023-04-04T16:52:44.025779","status":"completed"},"tags":[]},"source":["## Introduction\n","\n","Welcome to the Bellabeat data analysis case study! In this case study, we will perform many real-world tasks of a junior data analyst. You are a junior data analyst working on the marketing analyst team at Bellabeat, a high-tech manufacturer of health-focused products for women. Bellabeat is a successful small company, but they have the potential to become a larger player in the\n","global smart device market.\n","The case study follows the structure of ask, prepare, process, analyse, share and act. This is also the structure provided by the certification course.\n","\n","## Table of Contents\n","\n","1. Ask\n","2. Prepare\n","3. Process\n","4. Analyze\n","5. Share\n","6. Act\n","\n","## 1. Ask\n","\n","\n","\n"]},{"cell_type":"markdown","id":"4c0690e3","metadata":{"papermill":{"duration":0.004687,"end_time":"2023-04-04T16:52:44.045005","exception":false,"start_time":"2023-04-04T16:52:44.040318","status":"completed"},"tags":[]},"source":["Task: Analysing data from smart devices can help us understand the ways consumers use our product and to launch products that will help them and help in growth opportunities for the company.\n","*  Key Stakeholders:\n","1. Urška Sršen: Bellabeat’s co-founder and Chief Creative Officer\n","2. Sando Mur: Mathematician and Bellabeat’s co-founder\n","3. Bellabeat marketing analytics team — A team of data analysts responsible for collecting, analyzing, and reporting data to help Bellabeat’s marketing strategy\n","* Key questions to answer during analysis\n","1. What are latest trends in the smart devices?\n","2. How these trends affect Bellafast customers?\n","3. How can we integrate these trends in our upcoming products and is it beneficial?\n","4. How these trends affect or influence the marketing strategy of Bellabeat?\n","\n","## 2.Process\n","\n","Necessary packages needed for analysis"]},{"cell_type":"code","execution_count":1,"id":"a0e34a6b","metadata":{"collapsed":true,"execution":{"iopub.execute_input":"2023-04-04T16:52:44.060195Z","iopub.status.busy":"2023-04-04T16:52:44.057754Z","iopub.status.idle":"2023-04-04T16:52:45.349339Z","shell.execute_reply":"2023-04-04T16:52:45.347464Z"},"jupyter":{"outputs_hidden":true},"papermill":{"duration":1.303268,"end_time":"2023-04-04T16:52:45.352948","exception":false,"start_time":"2023-04-04T16:52:44.04968","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.0     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.1     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.1.8\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\u001b[36mℹ\u001b[39m Use the conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\u001b[23m) to force all conflicts to become errors\n"]}],"source":["library(tidyverse)\n","library(lubridate)\n","library(skimr)\n","library(ggplot2)\n","library(dplyr)"]},{"cell_type":"markdown","id":"5c2cf9c4","metadata":{"papermill":{"duration":0.004991,"end_time":"2023-04-04T16:52:45.362828","exception":false,"start_time":"2023-04-04T16:52:45.357837","status":"completed"},"tags":[]},"source":["Load the data provideded by \"FitBit Fitness Tracker Data\". These data are submitted by 30 FitBit users, including their minute-level output for physical activity, heart rate, and sleep monitoring. It includes information about daily activity, steps, weightlog, intensity, calorie intake, and heart rate all that on minutely, hourly, and daily basis that can be used to explore users’ habits, eating pattern and lifestyle.\n","These data are stored on [Kaggle](http://https://www.kaggle.com/datasets/arashnic/fitbit), which includes 18 .csv files. Few files are in Wide and Narrow formats.\n","Checking for ROCCC( Reliability, Original, Comprehensive, Current, Cited):\n","   *  Reliability: Data in this dataset has been contributed by 30 FitBit users consentually and the           data is generated by from a distributed survey via Amazon Mechanical Turk\n","   *  Original: The data is consented by 30 FitBit users, hence, it's original and the submission of           personal tracker data via Amazon Mechanical Turk\n","   *  Comprehensive: Data sample is small, data is recorded during certain days of a week and records         many factors such as sleeping, physical activity, heart rate, etc.\n","   *  Current: Data recorded is from March to May of 2016, so, its not current data as users activities       may have changed due to changed lifestyle and may not represent the current rends in smart device       usage.\n","   *  Cited: As stated before, Amazon Mechanical Murk created the dataset, but we have no information on       whether this is a credible source.\n","\n","This project will only 3 files, due to the scope of this project, : dailyActivity_merged, weightLogInfo, and sleepDay_merged.\n","These 3 dataset are chosen for 2 reasons: First, dailyActivity_merged covers the data from dailyCalories_merge, dailyIntensities_merged and dailySteps_merged data set. \n","Second, all three record users data in a daily bases, whereas other data are either hour, minute or second based."]},{"cell_type":"code","execution_count":2,"id":"2cad7fa2","metadata":{"collapsed":true,"execution":{"iopub.execute_input":"2023-04-04T16:52:45.405821Z","iopub.status.busy":"2023-04-04T16:52:45.374446Z","iopub.status.idle":"2023-04-04T16:52:45.483349Z","shell.execute_reply":"2023-04-04T16:52:45.480977Z"},"jupyter":{"outputs_hidden":true},"papermill":{"duration":0.118968,"end_time":"2023-04-04T16:52:45.486557","exception":false,"start_time":"2023-04-04T16:52:45.367589","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["33"],"text/latex":["33"],"text/markdown":["33"],"text/plain":["[1] 33"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["24"],"text/latex":["24"],"text/markdown":["24"],"text/plain":["[1] 24"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["8"],"text/latex":["8"],"text/markdown":["8"],"text/plain":["[1] 8"]},"metadata":{},"output_type":"display_data"}],"source":["dailyActivity <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyActivity_merged.csv\", stringsAsFactors = FALSE)\n","n_distinct(dailyActivity$Id)\n","\n","sleepDay <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/sleepDay_merged.csv\", stringsAsFactors = FALSE)\n","n_distinct(sleepDay$Id)\n","\n","weight <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/weightLogInfo_merged.csv\", stringsAsFactors = FALSE)\n","n_distinct(weight$Id)"]},{"cell_type":"markdown","id":"c42252f2","metadata":{"papermill"