=SedentaryMinutes, y=Calories)) + geom_point() +geom_smooth(method=lm)\n","# this scatterplot plots calories vs sedentary minutes"]},{"cell_type":"markdown","id":"fb98c5ce","metadata":{"papermill":{"duration":0.013463,"end_time":"2023-04-04T16:52:48.782726","exception":false,"start_time":"2023-04-04T16:52:48.769263","status":"completed"},"tags":[]},"source":["First scatterplot gives us the analysis that the more steps we take in a day, more calories are burned and will keep us healthy as more steps equals to less time being sedenatry.\n","Second scatterplot shows that we tend to require less calories as we're more sedemtary and become lethargic.\n","We conclude that FitBit users want to be more fit anc active, hence, they need to take more steps and to be less sedentary/lazy. Action needs to be taken on Monday, Tuesday, Thursday, and Saturday to increase their active times and total steps."]},{"cell_type":"markdown","id":"87ac6d1d","metadata":{"papermill":{"duration":0.013003,"end_time":"2023-04-04T16:52:48.808849","exception":false,"start_time":"2023-04-04T16:52:48.795846","status":"completed"},"tags":[]},"source":["## 5. Share\n","\n","\n","The main task of this part is:\n"," \n"," 1. Present the findings\n"," 2. Create an effective data visualization\n"," 3. Decide the perfect format/way to share\n"," 4. Easily accessible for everyone\n"," 5. Follow 5 seconds rule while creating visualization\n"," \n","This dataset is available to use and edit on Kaggle.com\n","\n","## 6. Act\n","\n","\n","Bellabeat should consider:\n"," \n"," 1. Using milestones for walking a certain distance everyday like Nike Run club app.\n"," 2. Using points system like SSG meaning you earn points for every milestone you complete while taking       steps like 10,000 steps a day, which can be used to redeem any electronic, skincare, or vouchers.\n"," 3. Displaying the negative effects of living a sedentary lifestyle and how it can cause heart diseases,     diabetes, obesity, high cholestrol.\n"," 4. And showing that even simple exercises like walking, jogging can lower their risk of potential life-     threating conditions\n"," \n","Additions that can be made in the future:\n"," \n"," 1. Correlations between sleep and calories intake/expenditure, for example, less sleep can make a           person to eat excessively leading them to obesity and less focus.\n"," 2. Correlation between heartbeat and sleep can help us to understand if sleeping less increases the         heart rate of a person or not.\n"," 3. Bellabeat's product \"Spring\" tracks user's water drinking behaviour, however, there are no direct       data related to this product. If these data are available, it may create interesting new                 observations.\n"," 4. Improvement for better app design and future seamless conncection and interaction between different     bellabeat products"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":8.501854,"end_time":"2023-04-04T16:52:48.943764","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-04-04T16:52:40.44191","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}